class Header extends Component{
    render() {
        return(
         <nav>
             <div className="nav-wrapper">
                 <a className="left brand-logo" style={{paddingLeft:5}}>
                     VT Emaily
                 </a>
                 <ul className="right">
                  <li>
                      <a>Login With Google</a>
                  </li>    
                 </ul>    
             </div>
         </nav>
        );
    }
}

export default Header;
